import React from 'react';

import './../App.css';
import Stats_CSS from './Stats.module.css';
const Stats = () => 
{
    return(
      <div className={Stats_CSS.stats}>
      <div>
  Сообщения
      </div>
      <div>
  Просмотры
      </div>
      <div>
  Вы нравитесь
      </div>
      <div>
  Вам нравятся
      </div>
      <div>
  Взаимные симпатии
      </div>
      </div>
    )
}

export default Stats;
